import SearchBar from "../SearchBar/SearchBar";
import styled from "./Nav.module.css";
import {Link} from "react-router-dom";

const Nav = ({onSearch}) => {
    return (
        <div className= {styled.Nav}>
            <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.hbomax.com%2Far%2Fes%2Fseries%2Furn%3Ahbo%3Aseries%3AGXkRjxwjR68PDwwEAABKJ&psig=AOvVaw2yktz0WGlFax0P-M-su9RF&ust=1679260721470000&source=images&cd=vfe&ved=0CA8QjRxqFwoTCNiq9uiz5v0CFQAAAAAdAAAAABAI"/>
        <Link to={"/Favorites"} className={styled.Link}>Favorites</Link>    
        <Link to = {"/home"} className={styled.Link} >Home</Link>  
        <Link to = {"/about"} className={styled.Link}>About</Link>
        <Link to={"/"} className = {styled.Link} >Logout</Link>
        <SearchBar onSearch={onSearch} />
        </div>
    )
}
{/*Home es ===> Cards*/}
export default Nav;
